import React from "react";
import classes from './RightContainer.module.css'

const RightContainer = ({user}) => {

    return(
        <div className={classes.container}>
            <p className={classes.label}>Логин</p>
            <p className="info">{user && user.name}</p>
            <p className={classes.label}>Почта</p>
            <p className="info">{user && user.mail}</p>
            <p className={classes.label}>Пароль</p>
            <p className="info">{user && user.password}</p>
        </div>
    )

}

export default RightContainer;
